import axios from 'axios';

const User = ({ users }) => (
  <div>
    <ul>
      {users.map((user) => (
        <li key={user.id}>{user.login}</li>
      ))}
    </ul>
  </div>
);

User.getInitialProps = async () => {
  const res = await axios.get(`https://api.github.com/orgs/rocketseat/members`);

  return { users: res.data };
};

export default User;
